static boolean get_ALKSpecJudge(void)
{
    uint8 result[4] = {0};
    uint8 row = 0;
    row = sizeof(result) / sizeof(result[0]);
    if(CarPara_LDPType == ON)
    {
        result[0] = iALK_SPEC_ALKB;
    }
    else
    {
        result[0] = iALK_SPEC_NONE;
    }

    if (CarPara_LKSType == ON)
    {
        result[1] = iALK_SPEC_ALKC;
        result[3] = iALK_SPEC_TJA;
    }
    else
    {
        result[1] = iALK_SPEC_NONE;
        result[3] = iALK_SPEC_NONE;
    }

    if (f_CarPara_EquipELK == ON)
    {
        result[2] = iALK_SPEC_ELK;
    }
    else
    {
        result[2] = iALK_SPEC_NONE;
    }

    for(uint8 i = 0; i < row; i++)
    {
        ALKSpec = ALKSpec | result[i];
    }

    for(uint8 i = 0; i < row; i++)
    {
        if( result[i] != 0)
        {
            return OFF;
        }

    }

    return ON;
}
static boolean is_equal(boolean *buf, uint8 size)
{
    for (uint8 i = 0; i < size; i++)
    {
        if (buf[i] != 0)
            continue;
        else
            return 0;
    }
    return 1;
}

